			shellScript = "echo build dir = $TARGET_BUILD_DIR\ncd \"$TARGET_BUILD_DIR\"\n\n#ensure old package is gone\nrm -f sauerbraten.dmg\n\n#make the directory which our disk image will be made of\n#use /tmp as a destination because copying ourself (xcode folder) whilst compiling causes the dog to chase its tail\nSAUERPKG=`mktemp -d /tmp/sauerpkg.XXXXXX` || exit 1\n\n#leave indicator of where temp directory is in case things break\nln -sf \"$SAUERPKG\" \"$TARGET_BUILD_DIR/sauerpkg\"\n\n#copy executable\n/Developer/Tools/CpMac -r \"$TARGET_BUILD_DIR/sauerbraten.app\" \"$SAUERPKG/Sauerbraten.app\"\nstrip -u -r \"$SAUERPKG/Sauerbraten.app/Contents/MacOS/sauerbraten\"\n\nHELPDIR=\"$SAUERPKG/Sauerbraten.app/Contents/Resources/help/\"\nGAMEDIR=\"$SAUERPKG/Sauerbraten.app/Contents/gamedata\"\nmkdir \"$GAMEDIR\"\n\n#copy readme and data and remove unneccesary stuff\n/Developer/Tools/CpMac -r \"$SRCROOT/../../README.html\" \"$HELPDIR/\"\n/Developer/Tools/CpMac -r \"$SRCROOT/../../docs\" \"$HELPDIR/\"\n/Developer/Tools/CpMac -r \"$SRCROOT/../../data\" \"$GAMEDIR/\"\n/Developer/Tools/CpMac -r \"$SRCROOT/../../packages\" \"$GAMEDIR/\"\n/Developer/Tools/CpMac -r \"$SRCROOT/../../src\" \"$SAUERPKG/sourcecode\"\nfind -d \"$SAUERPKG\" -name \".svn\" -exec rm -rf {} \\;\nfind \"$SAUERPKG\" -name \".DS_Store\" -exec rm -f {} \\;\nrm -rf \"$SAUERPKG/sourcecode/xcode/build\"\n\n#add alias to readme\n/usr/bin/osascript <<EOT\ntell application \"Finder\"\nset macSrcPath to POSIX file \"$HELPDIR/README.html\" as text\nset macDestPath to POSIX file \"$SAUERPKG\" as text\nmake new alias file to file macSrcPath at folder macDestPath\nend tell\nEOT\n\n#finally make a disk image out of the stuff\necho creating dmg\nhdiutil create -srcfolder \"$SAUERPKG\" -volname sauerbraten sauerbraten.dmg\nhdiutil internet-enable -yes sauerbraten.dmg\n\n#cleanup\nrm -rf \"$SAUERPKG\"\n";
		};
